import React, { Component } from "react";
import { Button, Checkbox, Form, Dimmer } from "semantic-ui-react";

const options = [
  { text: "", value: "" },
  { text: "Won", value: "won" },
  { text: "Loss", value: "loss" },
  { text: "Draw", value: "draw" },
  { text: "Leave/Disconnect", value: "leave" }
];

class Record extends Component {
  render() {
    return (
      <Grid>
        <Form>
          <Form.Select fluid label="Result" options={options} placeholder="" />
          <Form.Input
            fluid
            type="number"
            label="Current Ranking"
            placeholder="Current Ranking"
          />
          <Button type="submit">Submit</Button>
        </Form>
      </Grid>
    );
  }
}

export default Record;
